impl Solution {
    pub fn number_of_good_subarray_splits(nums: Vec<i32>) -> i32 {
        let mut ones = 0;
        let mut result = 0;
        let mut prefix_ones = vec![0; nums.len() + 1];
        let mut modu = 1_000_000_007;

        for (i, &num) in nums.iter().enumerate() {
            ones += num;
            prefix_ones[i + 1] = ones;
        }

        for i in 1..nums.len() {
            if prefix_ones[i] == 1 && prefix_ones[nums.len()] - prefix_ones[i] == 1 {
                result += 1;
                result %= modu;
            }
        }

        result
    }
}
